import './CSS/freewrite.css'

export const runnerCount = (runnerCountState, setRunnerCountState) => {

    return (
        <div>
            <div className="runnerCount">
                <i class={"fa-solid fa-diamond diamondfalse" + runnerCountState}></i>
                <i class={"fa-solid fa-diamond diamond" + runnerCountState}></i>
                <i class={"fa-solid fa-diamond diamond" + runnerCountState}></i>
            </div>
        </div>

    )
}
